import * as ReactDOM from "react-dom";
import HomeScreen from "./screens/HomeScreen";

function App() {
  return (
      <div>
        <header>
          <a href="/">Glitter</a>
        </header>
        <main>
      <BrowserRouter>

          <Routes>
            <Route path="/" element={<HomeScreen />} ></Route>
          </Routes>
      </BrowserRouter>

        </main>
      </div>
  );
}

export default App;
